import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import pageConfig from '../../utils/pageConfig';
import PageHeader from '../../components/PageHeader/PageHeader';
import { getActionsFormate } from '../../utils/common';
import { FOOTPRINTS_COMPONENTS } from '../../config';
import { COMPONENTS } from '../../utils/constants';


class ListPage extends React.Component {

  componentDidMount() {
    const { makeCall, page } = this.props;
    const { components } = pageConfig[page];
    console.log("make call:", this.props);
    components && components.map(comp=>{
      const type = FOOTPRINTS_COMPONENTS[comp].job.PAGE_DATA
      const params = this.props.match.params;
      console.log("Checking ", params);

      makeCall(type, {...params});
    })
  }

  render() {
    const { page } = this.props;

    const { pageTitle, actions, components } = pageConfig[page];
    let key = 0;
    console.log("Checking ", this.props);
    const Components = components && components.map(comp=>{
      const fpComp = FOOTPRINTS_COMPONENTS[comp];
      const fpCompData = this.props[comp];

      const Component = fpComp.component;
      const actions = fpComp.actions;
      key += 1;
     return(<Component {...this.props} key={key} data={fpCompData} actions={actions}/>)
    })
    return (
      <div className="list-page">
        <PageHeader title={pageTitle} actions={actions} />
        {Components}
        <div>Hello world</div>
      </div>
    );
  }
}

ListPage.propTypes = {
  page: PropTypes.string.isRequired,
  makeCall: PropTypes.func.isRequired,
  [COMPONENTS.DATA_CARD]: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired ,
  [COMPONENTS.USER]: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired,
};

ListPage.defaultProps = {};

const mapStateToProps = state => ({
  [COMPONENTS.DATA_CARD]: state.listReducerStore[COMPONENTS.DATA_CARD],
  [COMPONENTS.USER]: state.listReducerStore[COMPONENTS.USER]
});
const mapDispatchToProps = dispatch => {
  return {
    makeCall: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
};

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(ListPage)
);
